import React from 'react'

import { Helmet } from 'react-helmet'

import Navbar8 from '../components/navbar8'
import ChatStep1 from '../components/chat-step-1'
import './video-ai.css'

const VideoAI = (props) => {
  return (
    <div className="video-ai-container">
      <Helmet>
        <title>Video-AI - Character NFT template3</title>
        <meta
          property="og:title"
          content="Video-AI - Character NFT template3"
        />
      </Helmet>
      <Navbar8
        text={
          <fragment>
            <span className="video-ai-text">Account</span>
          </fragment>
        }
        view={
          <fragment>
            <span>+ NEW </span>
          </fragment>
        }
        link1={
          <fragment>
            <span className="video-ai-text02 thq-link thq-body-small">
              Link 1
            </span>
          </fragment>
        }
        link2={
          <fragment>
            <span className="thq-link thq-body-small">Link 2</span>
          </fragment>
        }
        link3={
          <fragment>
            <span className="video-ai-text04 thq-link thq-body-small">
              Link 3
            </span>
          </fragment>
        }
        link4={
          <fragment>
            <span className="thq-link thq-body-small">Link 4</span>
          </fragment>
        }
        page1={
          <fragment>
            <span className="video-ai-text06 thq-body-large">Page One</span>
          </fragment>
        }
        page2={
          <fragment>
            <span className="video-ai-text07 thq-body-large">Page Two</span>
          </fragment>
        }
        page3={
          <fragment>
            <span className="video-ai-text08 thq-body-large">Page Three</span>
          </fragment>
        }
        page4={
          <fragment>
            <span className="video-ai-text09 thq-body-large">Page Four</span>
          </fragment>
        }
        action1={
          <fragment>
            <span>Main Action</span>
          </fragment>
        }
        action2={
          <fragment>
            <span>Secondary Action</span>
          </fragment>
        }
        rootClassName="navbar8-root-class-name"
        page1Description={
          <fragment>
            <span className="thq-body-small">Page One Description</span>
          </fragment>
        }
        page2Description={
          <fragment>
            <span className="thq-body-small">Page Two Description</span>
          </fragment>
        }
        page3Description={
          <fragment>
            <span className="thq-body-small">Page Three Description</span>
          </fragment>
        }
        page4Description={
          <fragment>
            <span className="thq-body-small">Page Four Description</span>
          </fragment>
        }
      ></Navbar8>
      <ChatStep1
        text3={
          <fragment>
            <span>Download</span>
          </fragment>
        }
        header1111={
          <fragment>
            <span className="video-ai-text17">Video in DETAIL</span>
          </fragment>
        }
        text={
          <fragment>
            <span>Create Video</span>
          </fragment>
        }
        header31={
          <fragment>
            <span className="video-ai-text19 ai-word">DESCRIBEE</span>
          </fragment>
        }
        text2={
          <fragment>
            <span>TRY KIIBZZ AI</span>
          </fragment>
        }
        rootClassName="chat-step1-root-class-name"
      ></ChatStep1>
    </div>
  )
}

export default VideoAI
